// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract NFTAchievements is ERC721, Ownable {
    struct Achievement {
        string name;
        string description;
        uint256 requirement;
        uint8 achievementType; // 0: predictions, 1: social, 2: premium
        bool active;
    }

    mapping(uint256 => Achievement) public achievements;
    mapping(address => mapping(uint256 => bool)) public playerAchievements;
    mapping(uint256 => uint256) public tokenToAchievement;

    uint256 public nextTokenId = 1;
    uint256 public nextAchievementId = 1;

    event AchievementUnlocked(
        address indexed player,
        uint256 indexed achievementId,
        uint256 tokenId
    );

    constructor()
        ERC721("ZetaSocialFi Achievements", "ZSA")
        Ownable(msg.sender)
    {
        _initializeBasicAchievements();
    }

    function _initializeBasicAchievements() internal {
        // Basic achievements for testing
        achievements[nextAchievementId++] = Achievement({
            name: "First Prediction",
            description: "Make your first price prediction",
            requirement: 1,
            achievementType: 0,
            active: true
        });

        achievements[nextAchievementId++] = Achievement({
            name: "Social Starter",
            description: "Create your first post",
            requirement: 1,
            achievementType: 1,
            active: true
        });

        achievements[nextAchievementId++] = Achievement({
            name: "Cross Chain User",
            description: "Complete cross-chain transaction",
            requirement: 1,
            achievementType: 2,
            active: true
        });
    }

    function mintAchievement(
        address player,
        uint256 achievementId
    ) public onlyOwner {
        require(achievements[achievementId].active, "Achievement not active");
        require(
            !playerAchievements[player][achievementId],
            "Achievement already unlocked"
        );

        playerAchievements[player][achievementId] = true;
        uint256 tokenId = nextTokenId++;
        tokenToAchievement[tokenId] = achievementId;

        _mint(player, tokenId);

        emit AchievementUnlocked(player, achievementId, tokenId);
    }

    // Internal function to avoid calling public function from internal
    function _mintAchievement(address player, uint256 achievementId) internal {
        require(achievements[achievementId].active, "Achievement not active");
        require(
            !playerAchievements[player][achievementId],
            "Achievement already unlocked"
        );

        playerAchievements[player][achievementId] = true;
        uint256 tokenId = nextTokenId++;
        tokenToAchievement[tokenId] = achievementId;

        _mint(player, tokenId);

        emit AchievementUnlocked(player, achievementId, tokenId);
    }

    // Simple check for basic achievements
    function checkAndMintBasicAchievements(
        address player,
        uint256 totalPredictions,
        uint256 totalPosts,
        bool hasUsedCrossChain
    ) external onlyOwner {
        // First prediction achievement
        if (totalPredictions >= 1 && !playerAchievements[player][1]) {
            _mintAchievement(player, 1);
        }

        // First post achievement
        if (totalPosts >= 1 && !playerAchievements[player][2]) {
            _mintAchievement(player, 2);
        }

        // Cross-chain user achievement
        if (hasUsedCrossChain && !playerAchievements[player][3]) {
            _mintAchievement(player, 3);
        }
    }

    function getPlayerAchievements(
        address player
    ) external view returns (uint256[] memory) {
        uint256 count = 0;
        for (uint256 i = 1; i < nextAchievementId; i++) {
            if (playerAchievements[player][i]) {
                count++;
            }
        }

        uint256[] memory result = new uint256[](count);
        uint256 index = 0;
        for (uint256 i = 1; i < nextAchievementId; i++) {
            if (playerAchievements[player][i]) {
                result[index] = i;
                index++;
            }
        }
        return result;
    }

    // View functions
    function getAchievement(
        uint256 achievementId
    ) external view returns (Achievement memory) {
        return achievements[achievementId];
    }

    function hasAchievement(
        address player,
        uint256 achievementId
    ) external view returns (bool) {
        return playerAchievements[player][achievementId];
    }

    function getTokenURI(uint256 tokenId) public view returns (string memory) {
        require(_ownerOf(tokenId) != address(0), "Token does not exist");

        uint256 achievementId = tokenToAchievement[tokenId];
        Achievement memory achievement = achievements[achievementId];

        return
            string(
                abi.encodePacked(
                    "data:application/json;base64,",
                    _base64encode(
                        bytes(
                            abi.encodePacked(
                                '{"name":"',
                                achievement.name,
                                '",',
                                '"description":"',
                                achievement.description,
                                '",',
                                '"image":"https://zetasocialfi.com/achievements/',
                                _toString(achievementId),
                                '.png"}'
                            )
                        )
                    )
                )
            );
    }

    function _base64encode(
        bytes memory data
    ) internal pure returns (string memory) {
        // Simple base64 encoding for testing
        // In production, use a proper base64 library
        return "eyJuYW1lIjoiQmFzaWMgQWNoaWV2ZW1lbnQifQ==";
    }

    function _toString(uint256 value) internal pure returns (string memory) {
        if (value == 0) {
            return "0";
        }
        uint256 temp = value;
        uint256 digits;
        while (temp != 0) {
            digits++;
            temp /= 10;
        }
        bytes memory buffer = new bytes(digits);
        while (value != 0) {
            digits -= 1;
            buffer[digits] = bytes1(uint8(48 + uint256(value % 10)));
            value /= 10;
        }
        return string(buffer);
    }
}

contracts/SocialFiCore.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

import "@zetachain/protocol-contracts/contracts/zevm/interfaces/UniversalContract.sol";
import "@zetachain/protocol-contracts/contracts/zevm/interfaces/IGatewayZEVM.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract SocialFiCore is UniversalContract, Ownable {
    IGatewayZEVM public immutable gateway;
    address public immutable guiToken;

    struct Post {
        uint256 id;
        address author;
        string content;
        uint256 timestamp;
        uint256 likes;
        uint256 chainId;
    }

    struct UserProfile {
        address userAddress;
        string username;
        uint256 followers;
        uint256 totalPosts;
        uint256 socialScore;
    }

    mapping(uint256 => Post) public posts;
    mapping(address => UserProfile) public userProfiles;
    mapping(address => mapping(uint256 => bool)) public hasLikedPost;
    mapping(address => uint256[]) public userPosts;

    uint256 public nextPostId = 1;
    uint256 public constant POST_REWARD = 10 * 1e18; // 10 GUI tokens
    uint256 public constant LIKE_REWARD = 1 * 1e18; // 1 GUI token

    event PostCreated(
        uint256 indexed postId,
        address indexed author,
        uint256 chainId
    );
    event PostLiked(uint256 indexed postId, address indexed liker);
    event CrossChainSocialReward(
        address indexed user,
        uint256 amount,
        uint256 targetChain
    );

    constructor(address _gateway, address _guiToken) Ownable(msg.sender) {
        gateway = IGatewayZEVM(_gateway);
        guiToken = _guiToken;
    }

    // Cross-chain entry point
    function onCall(
        MessageContext calldata context,
        address zrc20,
        uint256 amount,
        bytes calldata message
    ) external onlyGateway {
        (uint8 action, bytes memory data) = abi.decode(message, (uint8, bytes));

        // Convert bytes to address properly
        address sender = address(
            uint160(uint256(keccak256(context.sender)) >> 96)
        );

        if (action == 1) {
            // Create post
            string memory content = abi.decode(data, (string));
            _createPost(sender, content, context.chainID);
        } else if (action == 2) {
            // Like post
            uint256 postId = abi.decode(data, (uint256));
            _likePost(sender, postId);
        } else if (action == 3) {
            // Claim social rewards cross-chain
            uint256 targetChain = abi.decode(data, (uint256));
            _claimSocialRewardsCrossChain(sender, zrc20, targetChain);
        }
    }

    function onRevert(
        RevertContext calldata revertContext
    ) external onlyGateway {
        // Handle revert logic for cross-chain operations
    }

    // Direct functions for same-chain interactions
    function createPost(string memory content) external {
        _createPost(msg.sender, content, block.chainid);
    }

    function likePost(uint256 postId) external {
        _likePost(msg.sender, postId);
    }

    function _createPost(
        address author,
        string memory content,
        uint256 chainId
    ) internal {
        require(bytes(content).length > 0, "Content cannot be empty");
        require(bytes(content).length <= 280, "Content too long");

        uint256 postId = nextPostId++;

        posts[postId] = Post({
            id: postId,
            author: author,
            content: content,
            timestamp: block.timestamp,
            likes: 0,
            chainId: chainId
        });

        userPosts[author].push(postId);
        userProfiles[author].totalPosts++;
        userProfiles[author].socialScore += 10;

        // Reward user for creating post
        IERC20(guiToken).transfer(author, POST_REWARD);

        emit PostCreated(postId, author, chainId);
    }

    function _likePost(address liker, uint256 postId) internal {
        require(posts[postId].id != 0, "Post not found");
        require(!hasLikedPost[liker][postId], "Already liked");

        hasLikedPost[liker][postId] = true;
        posts[postId].likes++;

        // Reward both liker and post author
        IERC20(guiToken).transfer(liker, LIKE_REWARD);
        IERC20(guiToken).transfer(posts[postId].author, LIKE_REWARD);

        userProfiles[posts[postId].author].socialScore += 2;

        emit PostLiked(postId, liker);
    }

    function _claimSocialRewardsCrossChain(
        address user,
        address zrc20,
        uint256 targetChain
    ) internal {
        uint256 socialReward = userProfiles[user].socialScore * 1e18;
        require(socialReward > 0, "No social rewards to claim");

        // Reset social score after claiming
        userProfiles[user].socialScore = 0;

        // Prepare call options
        CallOptions memory callOptions = CallOptions({
            gasLimit: 100000,
            isArbitraryCall: false
        });

        // Prepare revert options
        RevertOptions memory revertOptions = RevertOptions({
            revertAddress: user,
            callOnRevert: false,
            abortAddress: address(0),
            revertMessage: abi.encode("Social reward claim failed"),
            onRevertGasLimit: 1
        });

        // Send rewards cross-chain
        gateway.call(
            abi.encodePacked(user),
            zrc20,
            abi.encode(socialReward),
            callOptions,
            revertOptions
        );

        emit CrossChainSocialReward(user, socialReward, targetChain);
    }

    // View functions
    function getPost(uint256 postId) external view returns (Post memory) {
        return posts[postId];
    }

    function getUserProfile(
        address user
    ) external view returns (UserProfile memory) {
        return userProfiles[user];
    }

    function getUserPosts(
        address user
    ) external view returns (uint256[] memory) {
        return userPosts[user];
    }

    function getPostsByAuthor(
        address author
    ) external view returns (Post[] memory) {
        uint256[] memory postIds = userPosts[author];
        Post[] memory result = new Post[](postIds.length);

        for (uint256 i = 0; i < postIds.length; i++) {
            result[i] = posts[postIds[i]];
        }

        return result;
    }

    modifier onlyGateway() {
        require(msg.sender == address(gateway), "Only gateway");
        _;
    }
}

